var IndexController = {
    init : function() {
    	N("a#btnCommunicator").click(function(e) {

    getSourceCode : function(url, target) {
    	var isEmbed = target.parents(".popup__, .tab__, .result").length > 0 ? true : false;
    	if(!isEmbed) {
    		N.comm({
        		url : url,
        		contentType : "application/x-www-form-urlencoded",
        		dataType : "html"
        	}).submit(function(html) {
        		target.text(html.replace(/\t/g, "    "));
        	});
    	}
    }
}
$(document).ready(function() {
    IndexController.init();
});
